import React from 'react';

import { BrowserRouter as Router, Switch, Route, withRouter}from 'react-router-dom';

import SignIn from './auth/SignIn.js';
import SignUp from './auth/SignUp.js';
import Dashboard from './Dashboard.js';
import ExerciseDetails from './exercises/ExerciseDetails.js';
import CreateExercise from './exercises/CreateExercise.js';

function Navigation() {

    return (
    <div>
      <Router>
          <Switch>
            <Route exact path="/home" component={Dashboard}>
              <Dashboard />
            </Route>
            <Route path="/signin" component={withRouter(SignIn)}>

            </Route>
            <Route path="/signup" component={SignUp}>

            </Route>
            <Route path="/create" component={CreateExercise}>

            </Route>
            <Route exact path="/project/:id" component={ExerciseDetails}>

            </Route>
          </Switch>
        </Router>
      </div>)

}

export default Navigation;
